import React from 'react';
import  ReactDOM  from 'react-dom';


const Table = ()=> {
    const PointsOfTable = ['Пункт 0','Пункт 1','Пункт 2','Пункт 3']
    return (
        <ul>
        <li>PointsOfTable[0]</li>
        <li>PointsOfTable[1]</li>
        <li>PointsOfTable[2]</li>
        <li>PointsOfTable[3]</li>  
        </ul>
    );
};

const AppHeader= () => {
    return <h1>Data Table</h1>;
};

const SearchPanel= ()=>
{
    return <input placeholder="Search"/>;
};

const App = ()=>{
    return (
    <div>
    <AppHeader/>
    <SearchPanel/>
    <Table/>    
    </div>);
}


ReactDOM.render(<App/>, document.getElementById('root'));
